#!/usr/bin/python3

"""
from a youtube URL find the source video files

How ?
In the youtube HTML source code, the googlevideo links are present. But, they are URL encoded.

Where in HTML source code are they located ?
they are found in the second script tag inside div id=player ->player-wrap -> ytplayer.config.args.adaptive_fmts and ytplayer.config.args.url_encoded_fmt_stream_map 
Eg: See Eg at the bottom of the script

Algorithm:
1. Extract ytplayer.config.args.adaptive_fmts
2. Do a URLDecode on the value of adaptive_fmts
3. Split the resulting string by 'url=' delimiter
4. For each string snippet - 
	4.1 split by delimiter '\u0026' and keep the first part of array[0] and discard the rest of array
	4.2 do a URL request and check the response
		4.2.1 if the response is 403 log it and continue
		4.2.2 else if the response is 200 log it, mark as success , break and mark as complete
5. If each string snippet returned has a non 200 response then repeat steps with ytplayer.config.args.url_encoded_fmt_stream_map
6. If all URLs in step 5 also return a non 200 response then log the URL as irretrivable. 
7. If URL is irretrivable send out appropriate notification
"""








































































